const tasks = [
  {
    id: 1,
    text: "Doctors Appointment",
    day: "Jan 15th at 2:30pm",
    reminder: true,
  },
  {
    id: 2,
    text: "Cat Appointment",
    day: "Feb 24th at 2:30pm",
    reminder: true,
  },
  {
    id: 3,
    text: "House Appointment",
    day: "March 14th at 2:30pm",
    reminder: true,
  },
];

const Tasks = () => {
  return (
    <>
      {tasks.map((task) => (
        <h3 key={task.id}>{task.text}</h3>
      ))}
    </>
  );
};

export default Tasks;
